import React from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";

import { HomeStackNavigator, ProductStackNavigator,ToolsStackNavigator } from "./StackNavigator";
import { MaterialCommunityIcons } from '@expo/vector-icons';
import { FontAwesome5 } from '@expo/vector-icons'; 
import { MaterialIcons } from '@expo/vector-icons';
const Tab = createBottomTabNavigator();

const BottomTabNavigator = () => {
  return (
    <Tab.Navigator 
    tabBarOptions = {{activeBackgroundColor: '#242945', inactiveBackgroundColor: '#242945' , activeTintColor: 'white'}}
    >
      <Tab.Screen name="Home" component={HomeStackNavigator} options = {{tabBarIcon: ({ color }) => (
          <MaterialCommunityIcons name="home" color={color} size={26} />
      )}}
      />
      <Tab.Screen name="Product" component={ProductStackNavigator} options={{
      tabBarIcon: ({ color }) => (
        <FontAwesome5 name="store" size={22} />
      ),
    }}  />
      <Tab.Screen name="Tools" component={ToolsStackNavigator}  options={{
      tabBarLabel: 'Tools',
      tabBarIcon: ({ color }) => (
        <FontAwesome5 name="tools" color={color} size={26}  />
      ),
    }}  />
    </Tab.Navigator>
  );
};

export default BottomTabNavigator;
